import {connect} from 'react-redux';

const SongDetails = (props) => {
    return(
        console.log(props),
        <div>Song Detail</div>
    );
};

const mapStateToProps = state => {
    return(
        { song : state.selectedSong }
    );
};

export default connect(mapStateToProps)(SongDetails);
